import React, { useState } from 'react';
const m = [
    [1,4,12,2],
    [5,10,null,8],
    [13,11,3,7],
    [14,6,9,15]
];
const Main = () => {
    const [matrix,setMatrix] = useState(m);
    return <div>
        {matrix.map((value)=>{
            return <p key={'dffdfd'}>
                {value.map((item)=>{
                    return <span key={'123'}>{item}</span> 
                })}
            </p> 
        })}
    </div>
}

export default Main;
